export function filter(state = '', action) {
    switch (action.type) {
        case '@FILTERS/SET_FILTERS':
            return action.filterS;
        default:
            return state;
    }
}

const initPostState = {
    item: [
        {
            id: 0,
            tags: ['women','hoodie']
        },
        {
            id: 1,
            tags:['men','shirt']
        },
        {
            id: 2,
            tags:['hoodie']
        }

    ]
}

export function wardrobeReducer(state = initPostState, action) {
    return state;
}
